import React from 'react';
import './App.css';
import axios from 'axios'
import CompanyNetwork from './components/CompanyNetwork'
import MyNav from './components/nav'



class App extends React.Component {
  constructor(){
    super()
    this.state = {
      currentCompany:{}
    }
  }
  componentDidMount(){
    const api = axios.create({
      baseURL: 'http://localhost:9200/proto/_search?q=company_name:"Entreprise Services CDG"'
    })
    api.get('')
      .then(async(res) => {
        console.log(res.data.hits.hits[0]._source.company_name)
        this.setState({currentCompany:res.data.hits.hits[0]._source})
    });
  }

  render() {
    return (
      <div>
        <MyNav />
        <CompanyNetwork currentCompany={this.state.currentCompany}/>
      </div>
    )

  }
}

export default App;
